import React from "react";
import styled from "styled-components";
import colors from "./../../theme/colors";

const StyledLi = styled.li`
  width: 100%;
  list-style: none;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: space-between;
  border: 1px solid
    ${props =>
      props.sex ? props.colors.womenBorderColor : props.colors.menBorderColor};
  box-shadow: 0 0 20px -19px ${props => (props.sex ? props.colors.womenBorderColor : props.colors.menBorderColor)};
  margin: 0 auto 10px auto;
  padding: 5px;
  border-radius: 25px;
  overflow: hidden;
  height: 50px;

  &:last-of-type {
    margin: unset;
  }

  header {
    display: flex;
    align-items: center;
    justify-content: space-between;
    width: 100%;
    height: 50px;
    margin-bottom: 5px;

    div {
      height: 40px;
      width: 40px;
      border-radius: 50%;
      background-color: ${props => props.colors.imgBackgroundColor};
      overflow: hidden;
      img {
        height: 100%;
        width: 100%;
        object-fit: cover;
      }
    }

    h1 {
      font-size: 21px;
    }

    button {
      justify-self: flex-end;
      width: 40px;
      height: 40px;
      border-radius: 50%;
      background-color: ${props => props.imgBackgroundColor};
    }
  }

  h1,
  p {
    display: flex;
    flex-direction: column;

    span {
      font-size: 10px;
      font-weight: 300;
      text-transform: uppercase;
      color: grey;
    }
  }

  ul {
    display: flex;
    flex-direction: column;
    li {
      list-style: none;
    }
  }
`;

const User = ({ userData }) => {
  const {
    address: { city, street, houseNumber },
    _id,
    name,
    email,
    sex,
    avatar,
    age,
    __v
  } = userData;

  return (
    <StyledLi sex={sex} colors={colors}>
      <header>
        <div>
          <img src={avatar} alt={`${name}-image`} />
        </div>
        <h1>
          <span>ImiÄ™ i nazwisko</span>
          {name}
        </h1>
        <button>More</button>
      </header>
      <ul>
        <li>
          <p>
            <span>Adres zamieszkania</span>
            {city}, ul.{street} {houseNumber}
          </p>
        </li>
        <li>
          <p>
            <span>E-mail</span>
            <a href={`mailto:${email}`}>{email}</a>
          </p>
        </li>
        <li>
          <p>
            <span>Wiek</span>
            {age} lat
          </p>
        </li>
      </ul>
    </StyledLi>
  );
};

export default User;
